import React from 'react';

const VideoList = (props) => {
  const videos = props.videos.map((video) => {
    return (
      <iframe
        key={video.id.videoId}
        width="420"
        height="315"
        src={`https://www.youtube.com/embed/` + video.id.videoId}
      />
    );
  });

  return <div>{videos}</div>;
};

export default VideoList;
